import React from 'react';

function Card() {
	return ( 
		<div className='bg-black dib br3 pa3 ma2 grow bw2 shadow-5'>
			<img alt='robots' src='https://robohash.org/slade?200x200'/>
			<div>
				<h2>Slade Rose</h2>
				<p>sladerose@gmail.com</p>
			</div>
		</div>
	);
}

export default Card;
